INSERT INTO `v1_54efc602e070152378651e07e15662371ff6d4af9166382816f9ad655528c820` VALUES ("", 1070501, "ただ、そうですね……\n厚意に預かるばかり、\nというのも性に合いませんし。\n何かご褒美をあげましょう。", 11, 1, 1, 5, 0, 0, 107011, 1070501046);
INSERT INTO `v1_54efc602e070152378651e07e15662371ff6d4af9166382816f9ad655528c820` VALUES ("", 1070501, "", 91, "", "", "", "", "", 0, 1070501047);
