INSERT INTO `v1_54efc602e070152378651e07e15662371ff6d4af9166382816f9ad655528c820` VALUES ("", 1110501, "この蝋燭は、もしや君が作ったのか？\nなに、精油にそんな希少な成分を？\nわざわざぼくの誕生日を祝うために？\n後輩……君という子は……！", 11, 1, 1, 4, 0, 0, 111011, 1110501043);
INSERT INTO `v1_54efc602e070152378651e07e15662371ff6d4af9166382816f9ad655528c820` VALUES ("", 1110501, "", 91, "", "", "", "", "", 0, 1110501044);
INSERT INTO `v1_54efc602e070152378651e07e15662371ff6d4af9166382816f9ad655528c820` VALUES ("", 1110501, "vo_adv_1110501_002", 21, 0, "", 0, "", "", "vo_adv_1110501", 1110501045);
INSERT INTO `v1_54efc602e070152378651e07e15662371ff6d4af9166382816f9ad655528c820` VALUES ("", 1110501, "しかし蝋燭はいいが、この土台部分──\nいや、バースデーケーキとかいう祝祭の\n文化か。ううむ気持ちは有難いが、\n食の細いぼくには若干拷問サイズだ……", 11, 1, 1, 4, 0, 0, 111011, 1110501046);
INSERT INTO `v1_54efc602e070152378651e07e15662371ff6d4af9166382816f9ad655528c820` VALUES ("", 1110501, "", 91, "", "", "", "", "", 0, 1110501047);
