INSERT INTO `v1_54efc602e070152378651e07e15662371ff6d4af9166382816f9ad655528c820` VALUES ("", 1110501, "ややっ？　よくよく見ればこの土台、\nケーキなのはほんの一部分だけで、\n大半はよく出来た模造品じゃあないか！\nな、なんと配慮の行き届いた……！", 11, 1, 1, 5, 0, 0, 111011, 1110501049);
INSERT INTO `v1_54efc602e070152378651e07e15662371ff6d4af9166382816f9ad655528c820` VALUES ("", 1110501, "", 91, "", "", "", "", "", 0, 1110501050);
